import React from 'react';
import {Container, Form, Input} from 'semantic-ui-react';
const Login = () => {
	return(
		<div>
			<h3>Login</h3>
			<Container style="margin-">
				<Form>
					<Form.Field
						id="email"
						control={Input}
						label = "email"
						placeholder="email address"
						type="email"
					/>
					<Form.Field
						id="password"
						control={Input}
						label = "password"
						placeholder="password"
						type="password"
					/>	
				</Form>
			</Container>
		</div> 
	);
};

export default Login;
